function auto_size(n){n.style.height="5px";n.style.height=n.scrollHeight+4+"px"}function getcss(n,t){const i=document.querySelector(n);return t=="backgroundcolor"?i.style.backgroundColor:t=="transition"?i.style.transition:t=="width"?i.style.width:void 0}function setcss(n,t,i){const r=document.querySelectorAll(n);if(t=="backgroundcolor")for(let n=0;n<r.length;n++)r[n].style.backgroundColor=i;else if(t=="borderradius")for(let n=0;n<r.length;n++)r[n].style.borderRadius=i;else if(t=="color")for(let n=0;n<r.length;n++)r[n].style.color=i;else if(t=="height")for(let n=0;n<r.length;n++)r[n].style.height=i;else if(t=="transition")for(let n=0;n<r.length;n++)r[n].style.transition=i;else if(t=="width")for(let n=0;n<r.length;n++)r[n].style.width=i}class MudScrollManagerExtended{scrollToMiddle(n,t){let i=document.getElementById(n),r=document.getElementById(t);i.scrollTop=r.offsetTop-i.offsetHeight+i.offsetHeight/2+r.offsetHeight/2}}window.mudScrollManagerExtended=new MudScrollManagerExtended;